column8:
汎用。アメリカFOX製エアーダンパー。ストローク12インチ。窒素ガスを注入する事により、バネレートを変更可。車高調整も可。<br>
※現在は仕様変更により色がブルーからブラックになっています。<br>
表示価格は1本の価格になります。<br>
<br>

